sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

 //var subj = inputs.subject;
 var emc_state = inputs.subject.indexOf("PASS");

   // Check PASS keyword in the subject
  if (inputs.subject.indexOf("PASS")>-1){
    outputs.app_state = "0";
    gs.info("emc app state is Pass");     
    getAppName();
  }

   // Check FAIL keyword in the subject
  if (inputs.subject.indexOf("FAIL")>-1){  
    outputs.app_state = "1";
    gs.info("emc app state is FAIL");  
     getAppName();
  }

  function getAppName(){  
  var app_name = inputs.subject.slice(26);
  outputs.app_name = app_name;
  gs.info("emc app is "+ app_name);  
  }

  // Check PASS and FAIL keyword not provided in the subject
    if (inputs.subject.indexOf("PASS")==-1 && inputs.subject.indexOf("FAIL")==-1){  
    outputs.app_state = "3";
    gs.info("emc app state is REJECT");  
  }


})(inputs, outputs);

